import './Navbar.css'

// Components
import {NavLink, Link} from 'react-router-dom'
import {
    BsSearch, 
    BsHouseDoorFill, 
    BsFillPersonFill, 
    BsFillCameraFill
} from 'react-icons/bs'

const Navbar = () => {
  return (
    <nav id="nav">
        <Link to="/">ReactGram</Link>
        <form action=""></form>
    </nav>
  )
}

export default Navbar
